import React from 'react'

function Home() {
    const styles = {
        h2: {
            fontFamily: "Roboto, sans-serif",
            fontSize: "30px",
            color: "olive"
        },
        h4: {
            fontFamily: "Roboto, sans-serif",
            fontSize: "40px"
        }
    }
    return (
        <header>
            <h2 style={styles.h2}>Hello</h2>
            <h4 style={styles.h4}>Lovell</h4>
        </header>
    )
}

export default Home
